import React from 'react';


function Navbar() {
    return (

   <header>
 <nav class="navbar navbar-expand-lg navbar-white static-top">
 <div class="container">
 <button class="navbar-toggler btnnavbar" type="button" data-toggle="collapse" data-target="#navbarResponsive" aria-controls="navbarResponsive" aria-expanded="false" aria-label="Toggle navigation">
 <span class="navbar-toggler-icon"> 
 <img src="https://cdn2.iconfinder.com/data/icons/music-player-icons-line/45/Menu_Bar-512.png" alt="logo" style="height: 50px; width: 50px;"></img>
 </span>
 </button>   
 <div class="collapse navbar-collapse " id="navbarResponsive">

      </div>        
    </div>     
    </nav>
   </header>
    );
  }
export default Navbar;
